import React, { Component } from "react";
import "./App.css";
import NavBar from "./Components/NavBar";
import MainContainer from "./Components/MainContainer";

class App extends Component {
  state = {
    cards: [],
    loggedInUser: false
  };

  render() {
    return (
      <div>
        {loggedInUser ? <UserNavBar user = {loggedInUser}/> : <NavBar />}
        {loggedInUser ? <UserHome /> : <LoginPage />}
      </div>
    );
  }
}

export default App;
